import React, {Component} from 'react';
import './footer.scss'

export default function Footer() {
    const footerNav = {
        footer: [
            {
                name: 'Our World',
                description: 'Welcome to a place where visuals matter. On BeauDesignful, smart voices and original ideas take center stage - with no ads in sight. Watch',
                bonus: ''
            },

            {
                name: 'Create Your Future Today',
                description:'Find all topics you care interested in, and we will deliver the best ideas for your apetite. Explore.',
                bonus: ''
            },

            {
                name: 'Explore Our Projects',
                description: 'Thank you for being a member of WebDesignfull. You might get unlimited access to insightful stories from amazing designers and storytellers.',
                bonus: 'Browse More...'
            }
        ]
    };

    return (
        <div>
            <footer className="py-5">
                <h1 className="text-center">hello world</h1>

                <div className="container">
                    <div className="row">
                        {footerNav.footer.map(item => {
                            return (
                                <div className="col-lg-4">
                                    <h5>item.name</h5>
                                </div>
                            )
                        })}
                    </div>
                </div>

            </footer>
        </div>
    )
}
